"229329":{"id":"229329","name":"Sábado Com o Papai","slug":"sabado-com-o-papai","original_title":"Sabtu Bersama Bapak","overview":"A série mostra a jornada e os desafios da vida de um marido e sua esposa, Gunawan e Itje. Sabendo que sua morte está próxima, Gunawan grava uma série de vídeos para acompanhar seus dois filhos, Satya e Cakra. Gunawan pede que Itje deixe seus filhos assistirem aos vídeos que ele preparou todo sábado.","first_air_date":"2023-06-29","episode_run_time":0,"vote_average":7.3,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Adhitya Mulya"],"production_companies":["Falcon Pictures"],"genres":["Drama","Família"],"certification":"L","backdrop_path":"https://image.tmdb.org/t/p/original/i5JrD3vYfU6S6P5NUiOyw5RAxel.jpg","poster_path":"https://image.tmdb.org/t/p/original/q934JD4xqKlK611EthSpl48WtuN.jpg","cast":["Vino G. Bastian","Marsha Timothy","Adipati Dolken","Rey Mbayang","Enzy Storia"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/q934JD4xqKlK611EthSpl48WtuN.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/q934JD4xqKlK611EthSpl48WtuN.jpg","air_date":"2023-06-29","episode_count":6,"overview":"N/A","vote_average":8,"episodes":{"1":{"name":"Wawan Encontrando Caminhos","overview":"Gunawan tem que fazer uma difícil escolha entre cuidar da própria mãe ou começar uma nova vida. Dedi, irmão de Gunawan, não é de muita ajuda. Gunawan tem que lidar com as consequências das suas escolhas. Em seus dias fora do campo, Satya percebe que seus três filhos estão distantes. Rissa recebe uma oferta de trabalho em Jacarta. Cakra acaba de construir sua casa.","air_date":"2023-06-29","runtime":56,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":8},"2":{"name":"Os Dias Mais Difíceis","overview":"Gunawan já fez de tudo para cuidar da mãe, mas se vê diante de um problema quando é selecionado para uma vaga de emprego que exige que ele a deixe. O colega de Satya, Herman, vive se vangloriando de seu filho para Satya, por ele ter ganhado uma olimpíada de ciências. Por isso, Satya força Ryan, seu filho mais velho, a participar de uma também. Cakra é encarregado de criar um produto para a pele.","air_date":"2023-06-29","runtime":58,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"3":{"name":"O Dia Mais Movimentado","overview":"Depois do falecimento da mãe, Gunawan recomeça a vida do zero. Ele começa a trabalhar numa fábrica enquanto dá aulas com apenas uma meta: se casar com Itje. Satya prepara Ryan para a Olimpíada de Matemática sem perceber que esse não é o forte dele. Cakra conhece Ayu, uma nova funcionária da empresa, e se apaixona por ela. Cakra procura maneiras de se aproximar de Ayu, mas passa a impressão errada.","air_date":"2023-06-29","runtime":63,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"4":{"name":"Os Melhores Dias","overview":"Gunawan e Itje vivem uma vida modesta e feliz juntos. No trabalho, a carreira de Gunawan está de vento em popa. Itje abre um serviço de catering, e tudo vai bem. Eles têm dois filhos, Satya e Cakra. Mas então, Gunawan precisa enfrentar um novo problema. Satya discute com Rissa sobre a melhor forma de motivar Ryan. Cakra chama Ayu para um encontro, mas passa a impressão errada mais uma vez.","air_date":"2023-06-29","runtime":62,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"5":{"name":"Os Piores Dias","overview":"Gunawan e Itje passam pela quimioterapia com a esperança de que as coisas melhorem. Enquanto isso, o serviço de catering vai de mal a pior por conta da recessão. Gunawan perde o emprego. Sem contar para Satya e Rissa, Ryan não participa da Olimpíada de Matemática para a qual Satya o preparou. Cakra desiste do amor e se lamenta com Itje. Itje se oferece para apresentá-lo à filha de um amigo.","air_date":"2023-06-29","runtime":62,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"6":{"name":"Os Últimos Dias","overview":"A saúde de Gunawan não melhora, e a família tenta aceitar a situação. Gunawan tem a ideia de fazer vídeos para acompanhar Satya e Cakra ao longo dos anos. Satya descobre uma gravação de Rissa sacrificando a carreira por Satya e sua família. Satya pede que Rissa e sua família voltem para Jacarta. Cakra pede Ayu em casamento. Cakra descobre que há um último vídeo que ele precisa assistir.","air_date":"2023-06-29","runtime":63,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0}}}}},
