"135615":{"id":"135615","name":"A Jornada de Jin Wang","slug":"a-jornada-de-jin-wang","original_title":"American Born Chinese","overview":"Jin Wang é um adolescente americano comum que tem seus planos de ser aceito socialmente prejudicados com a chegada de Wei-Chen Sun, um estudante estrangeiro. Mas ao conhecer melhor Wei-Chen, Jin descobre que ele é filho de Sun Wukong, o legendário Rei Macaco, da mitologia chinesa. Quando Wei-Chen pede que Jin o ajude a achar um suposto Quarto Rolo, Jin precisa encarar os problemas do Céu e do ensino médio e, com isso, acaba descobrindo sua identidade.","first_air_date":"2023-05-24","episode_run_time":0,"vote_average":6.4,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Kelvin Yu"],"production_companies":["The Detective Agency","Mister John","Family Owned","20th Television"],"genres":["Comédia","Sci-Fi & Fantasy","Action & Adventure"],"certification":"10","backdrop_path":"https://image.tmdb.org/t/p/original/n5StTpznGP2zuagcZlQ3qUWZsrX.jpg","poster_path":"https://image.tmdb.org/t/p/original/kyCkaG3d37igICfgqNn0LZaHW9y.jpg","cast":["Ben Wang","楊雁雁","Chin Han","Ke Huy Quan","劉敬"],"trailer":"Vu1FgaIMXDY","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/kyCkaG3d37igICfgqNn0LZaHW9y.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/kyCkaG3d37igICfgqNn0LZaHW9y.jpg","air_date":"2023-05-24","episode_count":8,"overview":"N/A","vote_average":7.6,"episodes":{"1":{"name":"Que pessoa você é","overview":"Jin Wang começa o segundo ano do ensino médio com planos de entrar para o time de futebol, ser aceito socialmente e impressionar seu crush. Mas seus planos são prejudicados quando ele é forçado a se tornar amigo de Wei-Chen, um estudante estrangeiro que acaba de chegar. Em casa, os pais de Jin se desentendem por causa do emprego do pai. Enquanto isso, Sun Wukong, o Rei Macaco, procura seu bastão mágico, que foi roubado.","air_date":"2023-05-24","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/47qOIOn05Pswa2TVqGMMWP5xujK.jpg","vote_average":7},"2":{"name":"Um macaco numa missão","overview":"Desesperado para não chamar atenção e para se redimir depois de um desastroso teste para o time de futebol, Jin hesita em se posicionar após um vídeo com um meme racista em que ele aparece viralizar. Enquanto Wei-Chen se instala com sua \"tia\" Guanyin, a Deusa da Compaixão, Jin percebe que está sendo seguido por um misterioso jardineiro da escola. Enquanto isso, Simon tenta ser promovido no trabalho.","air_date":"2023-05-24","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/Aw4jKJrJ0ZaLXmCv3pc5nelMnPz.jpg","vote_average":6.7},"3":{"name":"Status de estrela do rock","overview":"Wei-Chen revela sua identidade celestial para Jin e pede a ajuda dele para achar o lendário Quarto Rolo. Jin concorda, mas é rapidamente distraído por um pedido dos seus novos colegas do time de futebol. Enquanto isso, o Demônio Touro, Niu Mowang, líder da insurreição contra o Céu, visita Guanyin. Christine vê uma oportunidade de negócios no pó medicinal que ela compra de uma herbalista idosa.","air_date":"2023-05-24","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/8ZUREsVw8EcowLjogCGDLbM8P8L.jpg","vote_average":8},"4":{"name":"Uma boa impressão","overview":"Nesse flashback, um jovem e rebelde Sun Wukong acompanha seu zeloso melhor amigo, Niu Mowang, ao Banquete Sublime dos Pêssegos Imortais. Nesse evento extravagante e exclusivo, Wukong pressiona Mowang a causar uma boa impressão e se oferecer pro papel de Grande Sábio, uma posição atualmente ocupada pelo Dragão Rei, Ao Guang.","air_date":"2023-05-24","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/zqVzT7nPOg0etceo4nX4fcWZkWp.jpg","vote_average":8},"5":{"name":"Abracadabra","overview":"Com a ajuda do novo informante, Ji Gong, Wei-Chen descobre que o Quarto Rolo pode ter alguma coisa a ver com os pais de Jin. Do outro lado da cidade, Jin trabalha em um projeto de biologia com Amelia que se abre com ele sobre seus próprios dramas familiares. Enquanto isso, a relação de Simon e Christine fica mais tensa à medida que segredos são revelados.","air_date":"2023-05-24","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/p0ypjVfSSshggkSTl95iNKdrjeP.jpg","vote_average":7},"6":{"name":"Coisa picante","overview":"Amelia organiza uma festa de aniversário para Jin no boliche, e Wei-Chen aparece sem ser convidado e sem saber que foi seguido por Niu Mowang. Guanyin leva o pingente de jade a uma especialista para verificar se é de fato o Quarto Rolo. Simon e Christine tentam conversar, mas continuam distantes. Jamie Yao, o ator que interpretou Freddy Wong, é convidado a voltar para um programa que reunirá o elenco novamente.","air_date":"2023-05-24","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/ysxqWjaPVjSDmSiAz6Cfrqqpr8r.jpg","vote_average":8.5},"7":{"name":"Sem conserto","overview":"Quando Guanyin conta a Wei-Chen que o pingente não era o Quarto Rolo, sua esperança de salvar o pai de Niu Mowang diminui. Enquanto isso, Jin descobre que é possível que seus pais se separem e reage mal, indo acabar na diretoria da escola. Longe dali, na reunião do elenco do programa “Sem conserto”, Jamie Yao fala da época em que interpretou Freddy Wong.","air_date":"2023-05-24","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/7dM2CYPjmwIIkbIyuOFJbTAbH1n.jpg","vote_average":7.5},"8":{"name":"O Quarto Rolo","overview":"Num sonho, Guanyin conta a Jin que o Touro Demônio irá até a escola para abrir um portal e destruir o Céu. Enquanto Wei-Chen lida com a perda do pai, Jin e Anuj o chamam para ajudá-los a deter o Touro Demônio antes que ele possa executar seu plano. Simon e Christine tentam ajudar um homem misterioso que está ferido.","air_date":"2023-05-24","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/aHAkeIjeeMAgvCAqD8NFctVBTNQ.jpg","vote_average":8.5}}}}},
