"195747":{"id":"195747","name":"Clube das Mães","slug":"clube-das-maes","original_title":"그린마더스클럽","overview":"Cinco mães de uma comunidade escolar competitiva têm uma relação entre amizade e rivalidade, presas em uma teia de segredos e inveja.","first_air_date":"2022-04-06","episode_run_time":69,"vote_average":4.8,"number_of_seasons":1,"number_of_episodes":16,"created_by":[],"production_companies":["SLL","Megaphone"],"genres":["Drama","Mistério"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/cnLMUW9GEtMrgSuPKjpGOXjPFFT.jpg","poster_path":"https://image.tmdb.org/t/p/original/UOpNwIeNAj9YzCgHoHuZb4JK6o.jpg","cast":["이요원","추자현","김규리","장혜진","주민경"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/UOpNwIeNAj9YzCgHoHuZb4JK6o.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/UOpNwIeNAj9YzCgHoHuZb4JK6o.jpg","air_date":"2022-04-06","episode_count":16,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Nem todos os vizinhos são bons vizinhos","overview":"Em busca de um recomeço, Lee Eun-pyo se muda para um novo apartamento e encontra um bilhete recomendando ter cuidado com a mãe de Kim Yu-bin.","air_date":"2022-04-06","runtime":69,"still_path":"https://image.tmdb.org/t/p/original/crk6Xu1JOXsXgnbosfzVSVp8FOS.jpg","vote_average":0},"2":{"name":"Adultos não fazem amigos sem motivos","overview":"Eun-pyo se preocupa ao ver o filho Jung Dong-seok atrapalhando a aula. Byeon Chun-hui é escolhida como a nova representante de classe do segundo semestre.","air_date":"2022-04-07","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/6rcpWcFYGcemLY8gIzoVuUE2I6w.jpg","vote_average":0},"3":{"name":"Aquele amanhecer antes de o sol raiar","overview":"Eun-pyo ouve uma conversa das mães da escola falando muito mal do comportamento do filho e decide deixar o bairro em que mora para matriculá-lo em outro colégio.","air_date":"2022-04-13","runtime":68,"still_path":"https://image.tmdb.org/t/p/original/z94BoANxiObibjF1ISY9mHpPzzz.jpg","vote_average":0},"4":{"name":"Fazendo parte do Clube das Mães","overview":"Eun-pyo tenta colocar Dong-seok no grupo de Yu-bin para a competição Rube Goldberg. E o filho de Seo Jin-ha, Henry Benuel, entra para um grupo rival.","air_date":"2022-04-14","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/oMvQKCgTnX9xfUjtNoWsSRmqDkd.jpg","vote_average":0},"5":{"name":"Um casal perfeito com um destino infeliz","overview":"Na exposição de arte, Eun-pyo esbarra em alguém que preferia evitar e Jin-ha encontra uma pessoa ligada ao seu passado difícil.","air_date":"2022-04-20","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/qRj9ZGovs7wdOVQpuvh9To6bIh.jpg","vote_average":0},"6":{"name":"Uma carta dos mortos","overview":"Quando uma tragédia abala a comunidade, todos tentam descobrir o que houve e arranjar álibis. Eun-pyo encontra um bilhete misterioso.","air_date":"2022-04-21","runtime":70,"still_path":"https://image.tmdb.org/t/p/original/v39EJ9JNMIwLoiaSM8wbZlAYqKo.jpg","vote_average":0},"7":{"name":"A letra escarlate","overview":"Com o crescimento dos boatos, as mães são chamadas para uma reunião na escola. Jung Jae-yong enfrenta verdades difíceis quando o passado da esposa vem à tona.","air_date":"2022-04-27","runtime":69,"still_path":"https://image.tmdb.org/t/p/original/3vGZdEXMnOgeOCLiAaTYBJe81TY.jpg","vote_average":0},"8":{"name":"Sua mentira descarada","overview":"Vendo que o caso está perto do fim, Jae-yong precisa agir com rapidez para encontrar a verdadeira causa da morte. E os boatos não param de aumentar.","air_date":"2022-04-28","runtime":68,"still_path":"https://image.tmdb.org/t/p/original/oedCiMaGhkBuaKhR3FlRnz36Xc1.jpg","vote_average":0},"9":{"name":"Rumo ao top 0,01%","overview":"Para proteger a família e conquistar a sonhada ascensão social, Eun-pyo aposta no talento de Dong-seok. Kim Yeong-mi começa a desconfiar do marido.","air_date":"2022-05-04","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/1AgXULb70GmoUCZ40mD7vRFDwCR.jpg","vote_average":0},"10":{"name":"Vento da ponta da espada","overview":"Após receber informações de uma fonte, Louis Benuel interroga Chun-hui e Lee Man-su. Dong-seok aparece em um programa de TV para crianças superdotadas.","air_date":"2022-05-05","runtime":69,"still_path":"https://image.tmdb.org/t/p/original/d37hyGjKlViH0czFcaGZKenwtVA.jpg","vote_average":0},"11":{"name":"Os pecados que não descobrimos","overview":"Dong-seok é avaliado por uma terapeuta. Chun-hui lida com o comportamento estranho de Yu-bin. Eun-pyo vai atrás da única pessoa que pode ajudar seu filho.","air_date":"2022-05-11","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/nqHZ6mpA2Gekc2wLcaPenGNPr1u.jpg","vote_average":0},"12":{"name":"Adultos também podem fazer amigos sem motivos?","overview":"Eun-pyo faz as pazes com outra mãe que está no mesmo barco que ela. Chun-hui enfrenta uma pressão financeira cada vez maior. Yeong-mi descobre uma pasta secreta.","air_date":"2022-05-12","runtime":69,"still_path":"https://image.tmdb.org/t/p/original/x7GufI9HbIB5i0RQurlsjLnR2ln.jpg","vote_average":0},"13":{"name":"As duas faces da verdade","overview":"Eun-pyo dá uma notícia chocante a Chun-hui, que recomenda não fazer nada. Mas isso só deixa Eun-pyo mais disposta a buscar a verdade.","air_date":"2022-05-18","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/jqt017SZpqGuzMD9Narrt7OaCHw.jpg","vote_average":0},"14":{"name":"Luz amarela","overview":"Chun-hui dá um ultimato ao marido, mas não sabe como vai sustentar a família sozinha. A faxineira de Jin-ha conta um segredo a Eun-pyo.","air_date":"2022-05-19","runtime":70,"still_path":"https://image.tmdb.org/t/p/original/dFiPWW2dNbbsjG1SsUq3svtlszq.jpg","vote_average":0},"15":{"name":"Escolha humana","overview":"Park Yun-ju sai para beber e testemunha uma cena suspeita. Quando chega uma mensagem no celular de Jung Jae-yong, Eun-pyo toma uma decisão definitiva.","air_date":"2022-05-25","runtime":72,"still_path":"https://image.tmdb.org/t/p/original/3Y3BkEAZFcPJ4KCD3c8aMETnmds.jpg","vote_average":0},"16":{"name":"A mão quente que você estende","overview":"Ao ser interrogada pela polícia, Chun-hui diz o nome de quem considera o verdadeiro suspeito. Henry faz uma confissão terrível ao pai.","air_date":"2022-05-26","runtime":81,"still_path":"https://image.tmdb.org/t/p/original/qCanTiaUn4nIcMfJ5al6BpKpvjI.jpg","vote_average":0}}}}},
