"115255":{"id":"115255","name":"What If Collab","slug":"what-if-collab","original_title":"What If Collab","overview":"Os filmmakers Diana e Leo viajam pra lugares que nunca foram pra criar video collabs com pessoas que nunca viram, usando a arte pra se conectar com desconhecidos.","first_air_date":"2019-01-01","episode_run_time":30,"vote_average":0,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":[],"genres":[],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/qg1ymh2Eqf48PcWjBKTl59q86Nz.jpg","poster_path":"https://image.tmdb.org/t/p/original/moUaFByzlcfe97bDV1OgYH8Z1yI.jpg","cast":["Leo Longo","Diana Boccara"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/moUaFByzlcfe97bDV1OgYH8Z1yI.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/moUaFByzlcfe97bDV1OgYH8Z1yI.jpg","air_date":"2019-01-01","episode_count":8,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Joanesburgo","overview":"Joanesburgo é a primeira parada de Diana e Leo pelo mundo. Na África do Sul eles têm 7 dias pra encontrar artistas locais e gravar um vídeo, porém o grupo de dança que convidam diz não. A 3 dias de deixar o país, os acontecimentos os surpreendem.","air_date":"2019-01-01","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/ksfSpjpr1C6VJAgo9mvxzAy24xQ.jpg","vote_average":0},"2":{"name":"Tel Aviv","overview":"Estar em um lugar que não conhecemos pode ser super instigante, mas também intimidador. Em Tel Aviv, onde tudo é novo para Diana e Leo, eles se desafiam a convidar um grupo de circo urbano e uma banda local para criar uma apresentação coletiva juntos.","air_date":"2019-01-01","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/l2S7eveYeHclwL20Bu9ra8eIXyf.jpg","vote_average":0},"3":{"name":"Copenhagen","overview":"No terceiro episódio, Diana e Leo chegam à Dinamarca, um país conhecido pela boa qualidade de vida e por ser um dos lugares com maior índica de felicidade do mundo. Mas também é conhecido por ser um país frio, de pessoas mais fechadas. Como será que a dupla irá se conectar com as pessoas que moram em Copenhagen?","air_date":"2019-01-01","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/ja8iqKOi6nI9qIUgmoAx5CP5ccf.jpg","vote_average":0},"4":{"name":"Singapura","overview":"Neste episódio, Diana e Leo enfrentam muitos problemas no dia da gravação Mas ao invés dos desafios distanciá-los das pessoas, foi exatamente isso que fez com que o casal se aproximasse mais ainda de todos os artistas envolvidos.","air_date":"2019-01-01","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/eVANMNEbRLe4z0xV5Y5zStvfAfK.jpg","vote_average":0},"5":{"name":"Hobart","overview":"No quinto episódio, Leo e Diana chegam a capital da Tasmânia onde, pela primeira vez, convidam apenas um artista pra se juntar a eles. Como será pra Jed, um trovador, se juntar a dois estranhos que chegam à sua cidade pra colaborar?","air_date":"2019-01-01","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/AealjjJcTjT6LvydKgFmhY9UEHx.jpg","vote_average":0},"6":{"name":"Toronto","overview":"Após 2 meses na estrada, Diana e Leo chegam a Toronto e são surpreendidos por Phil, um jornalista e DJ, que ama sair pelas ruas da cidade pra gravar vídeos dançando.","air_date":"2019-01-01","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/rrHOtCtevYKoCqGzWtFe4nBwmv3.jpg","vote_average":0},"7":{"name":"Santo Domingo","overview":"No sétimo episódio, Diana e Leo chegam a República Domenicana, onde são surpresos por algumas dificuldades. Será que o casal irá conseguir realizar a collab em Santo Domingo?","air_date":"2019-01-01","runtime":21,"still_path":"https://image.tmdb.org/t/p/original/lU9m76FUenAFgY4PYgyMnwBdXOY.jpg","vote_average":0},"8":{"name":"Manaus","overview":"Quão longe você iria pra provar algo que acredita? Diana e Leo deram a volta ao mundo pra provar que, quando estranhos se juntam para realizar um desafio, a relação de confiança que criam pode impactar positivamente a forma como vivemos. Em Manaus, eles encerram essa linda jornada pelo mundo.","air_date":"2019-01-01","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/6O99beCffhZYY13N7dNRm9iTnOj.jpg","vote_average":0}}}}},
