"82798":{"id":"82798","name":"1983","slug":"1983","original_title":"1983","overview":"Neste suspense sombrio de história alternativa, um estudante de direito ingênuo e um policial veterano descobrem uma conspiração que tiranizou a Polônia por décadas.","first_air_date":"2018-11-30","episode_run_time":60,"vote_average":6.516,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Joshua Long","Maciej Musiał"],"production_companies":["House Media Company"],"genres":["Drama","Crime","Mistério"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/fFeUzsieVuARo6a3CQqw2dMw5T4.jpg","poster_path":"https://image.tmdb.org/t/p/original/zv2R0UvZ93hpeNcIkSKDeHtQC3S.jpg","cast":["Robert Więckiewicz","Maciej Musiał","Michalina Olszańska","Andrzej Chyra","Zofia Wichłacz"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/nC5n69Vs4cAzP0c8z2gq0eDXFis.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/nC5n69Vs4cAzP0c8z2gq0eDXFis.jpg","air_date":"2018-11-30","episode_count":8,"overview":"N/A","vote_average":6,"episodes":{"1":{"name":"Envolvimento","overview":"Uma facção de rebeldes se prepara para um ataque. O policial Anatol examina um aparente suicídio, e o estudante Kajetan recebe uma pista sobre um antigo assassinato.","air_date":"2018-11-30","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/85bY4VBeJyXSuxSy14kUdg0KLGF.jpg","vote_average":7},"2":{"name":"Reversão","overview":"Segredos se infiltram entre o alto comando militar. Kajetan faz uma descoberta perigosa sobre a fotografia. A investigação de Anatol recebe respostas evasivas.","air_date":"2018-11-30","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/apnRyrOahNrKTwP6uCKgF0bXpnS.jpg","vote_average":6},"3":{"name":"Alinhamento","overview":"Anatol segue uma pista e prepara uma armadilha para a Brigada Ligeira. Ofelia planeja ganhar a confiança de Kajetan. Swietobor atrai os americanos para seu plano.","air_date":"2018-11-30","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/lAa6Ez8XoCcWPSE95NSHm74lDRo.jpg","vote_average":6},"4":{"name":"Consequência","overview":"Indo cada vez mais fundo, Kajetan procura respostas na casa abandonada. Tio conta um segredo espantoso para Anatol. Espiões descobrem a intenção de Świętobór.","air_date":"2018-11-30","runtime":56,"still_path":"https://image.tmdb.org/t/p/original/eajuZTi3wgsNFgEnFwN3M1ettcf.jpg","vote_average":5},"5":{"name":"Santuário","overview":"O plano de Ofelia de recrutar um novo membro dá errado. Anatol dá uma nova tarefa a Kajetan e descobre um sinal evidente dos métodos da Brigada Ligeira.","air_date":"2018-11-30","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/nIAH6oYdjUnZjW0X2Ie6XpefKwC.jpg","vote_average":6},"6":{"name":"Subversão","overview":"Anatol faz uma descoberta alarmante sobre a família de Kajetan. Rolbiecki conta com o informante, enquanto Świętobór prepara seu plano para execução.","air_date":"2018-11-30","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/AvbcOspZ708gSJY3bDzQCXhr3sC.jpg","vote_average":6},"7":{"name":"Mayday","overview":"Confrontada com uma farsa cruel, a Brigada Ligeira planeja sua jogada final. Sob as objeções ferozes de Anatol, Kajetan prossegue e atinge uma encruzilhada.","air_date":"2018-11-30","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/fqNqSVh3IEiITvCWlwz3docpFCZ.jpg","vote_average":6},"8":{"name":"Réquiem","overview":"Świętobór dá início à Operação Leão do Norte. Anatol e a Brigada Ligeira enfrentam traições. Kajetan fica sabendo de um segredo emocionante -- e foge.","air_date":"2018-11-30","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/oLTpBky9vaNUrb7BPbPBi2cl0LD.jpg","vote_average":6}}}}},
